import React from 'react';
import { StyleSheet, Text, TouchableOpacity, View, Image} from 'react-native';
import Ionicons from "react-native-vector-icons/Ionicons"


const RowTypes = (props) => {

    return(
        <View style={styles.Container}>
          {/* image */}
          <Image style={styles.image} source={require('../../assets/ambulance3d.jpg')}></Image>

          <View style={styles.middleContainer}>
            <Text style= {styles.type}> Ambulance
                <Ionicons name={'person'} size ={12} />
                3
            </Text>
            <Text style={styles.time}>
                8:03 pm drop off
            </Text>

          </View>
       
          <View style={styles.rightContainer}>
            <Ionicons name={'pricetag'} size ={18} color={'red'} />
            <Text style={styles.price}> 
                ksh 3000
            </Text>


          </View>
            
        </View>
    )
}
const styles = StyleSheet.create({
    Container:{

    },
    image:{
        height:50,
        width:50,
        resizeMode:'cover',
    },
    middleContainer:{

    },
    time:{

    },
    rightContainer:{

    },
    price:{

    },

   

  });
export default RowTypes;
